export default function donations() {
    return (
        <div className="main">

            <h1>WE ARE LOOKING FOR...</h1>
            <div className="container">
                <link href="https://fonts.googleapis.com/css2?family=Poppins:ital,wght@0,300;0,600;1,700&display=swap" rel="stylesheet"></link>
                <div>
                    <ul className="list">
                        <li>100% Cotton Fabric</li>
                        <li>Flannel</li>
                        <li>T-shirts</li>
                        <li>Sheets</li>
                        <li>Elastic</li>
                        <li>Bias Tape</li>
                    </ul>
                </div>

                <div className="image">
                    <img className="noContact" src='/noContact.jpeg' alt="No Contact Pic" />
                </div>
            </div>
            <p class="safe">You can drop off goods while still maintaining your social distance. For locations, click here. </p>

            <style jsx>{`
            h1 {
                font-family: Poppins;
                font-style: italic;
                color: #ede1d0;
            }
            h2 {
                font-family: Poppins;
                color: #ede1d0;
            }
            h3 {
                text-align: left;
                font-family: Poppins;
                color: #ede1d0;
            }
            p {
                color: #ede1d0;
                font-family: Poppins;

            }
            .main {
                background-color: #2F2D2A;
                width: 100vw;
                height: 100vh;
            }
            ul {
                color: #ede1d0;
                font-family: Poppins;
            }
            .noContact {
                border: 1px solid #ddd;
                border-radius: 4px;
                padding: 5px;
                width: 150px;
            }
            .container {
                display: flex;
                height: 75vh;
            }

            .image {
                display: flex;
            }

             `}</style>
        </div >

    );
}
